pragma solidity >=0.8.12;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "./collection/FNFTCollection.sol";
import "./single/FNFT.sol";

contract FNFTFactory {

  function createSingle(ERC721 token, uint256 tokenId, string memory name, string memory symbol, uint256 totalSupply) public {
    ERC20 fnft = new FNFT(
      token,
      tokenId,
      name,
      symbol,
      msg.sender,
      totalSupply
    );
    emit CollectionFNFTCreated(address(fnft));
  }

  function createCollection(string memory name, string memory symbol, uint256 totalSupply, ERC721[] memory nft, uint256[] memory ids) public {
    FNFTCollection fnft = new FNFTCollection(
      name,
      symbol,
      msg.sender,
      totalSupply,
      nft,
      ids
    );
    emit SingleFNFTCreated(address(fnft));
  }

  event SingleFNFTCreated(address fnft);
  event CollectionFNFTCreated(address fnft);
}","keccak256":"0x14bc4a7b5a8be7781e6886f8a9383dbe8d0c9a383f49010ad01d005c325e3a61","license":"MIT"},"contracts/fnft/collection/FNFTCollection.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity >=0.8.12;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import './Votable.sol';

contract FNFTCollection is ERC20, Votable {
  ERC721[] public nfts;
  mapping(ERC721 => uint256[]) tokenIds;
  address public minter;

  constructor(
    string memory name,
    string memory symbol,
    address _minter,
    uint256 totalSupply,
    ERC721[] memory _nfts,
    uint256[] memory _tokenIds
  ) ERC20(name, symbol) {
    minter = _minter;
    require(_nfts.length == _tokenIds.length, "FNFTCollection: nfts and tokenIds length mismatch");
    for(uint i = 0; i < _nfts.length; i++) {
      _nfts[i].transferFrom(_minter, address(this), _tokenIds[i]);
    }
    _mint(_minter, totalSupply);
  }

  function tryMint(ERC721 nft, uint256 tokenId, uint256 mintAmount) public {
      nft.transferFrom(msg.sender, address(this), tokenId);
      uint256 subjectId = addSubject(nft, tokenId, SubjectAction.MINT, minter, mintAmount);
      emit MintRequested(subjectId, nft, tokenId, msg.sender, mintAmount);
  }

  function executeMint(ERC721 nft, uint256 tokenId) public {
    VoteSubject memory subject = resolveSubject(nft, tokenId);
    _mint(subject.requester, subject.fractionAmount);
  }

  function tryRedeem(ERC721 nft, uint256 tokenId, uint256 payAmount) public {
    transferFrom(msg.sender, address(this), payAmount);
    uint256 subjectId = addSubject(nft, tokenId, SubjectAction.REDEEM, minter, payAmount);
    emit RedeemRequested(subjectId, nft, tokenId, msg.sender, payAmount);
  }

  function executeRedeem(ERC721 nft, uint256 tokenId) public {
    VoteSubject memory subject = resolveSubject(nft, tokenId);
    _burn(address(this), subject.fractionAmount);
    nft.transferFrom(address(this), msg.sender, tokenId);
  }
}","keccak256":"0xd9af952d51e75cbef8bff005dd31c4fb2f98e46996a224c8f6ac3a7efa24e78e","license":"MIT"},"contracts/fnft/collection/Votable.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity >=0.8.12;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";

abstract contract Votable is ERC20 {
  uint256 public subjectIdIndex;
  mapping(address => mapping(uint256 => VotingState)) votingState;
  mapping(ERC721 => mapping(uint256 => uint256)) subjectIds;
  uint256[] progressSubjectIds;
  mapping(uint256 => VoteSubject) subjects;

  function getLockedAmount(address voter) public view returns (uint256) {
    uint256 totalAmount = 0;
    for(uint256 i = 0; i < progressSubjectIds.length; i++) {
      VotingState memory state = votingState[voter][progressSubjectIds[i]];
      if(state.amount == 0) {
        continue;
      }
      totalAmount += state.amount;
    }
    return totalAmount;
  }

  function vote(ERC721 nft, uint256 tokenId, bool isYes, uint256 votingAmount) public {
    uint256 balance = balanceOf(msg.sender);
    uint256 subjectId = subjectIds[nft][tokenId];
    VoteSubject storage subject = subjects[subjectId];
    uint256 alreadyVotedAmount = votingState[msg.sender][subjectId].amount;
    uint256 lockedAmount = getLockedAmount(msg.sender);
    uint256 maxVotableAmount = balance + lockedAmount;

    require(!subject.isEnded, "Subject is ended");
    require((alreadyVotedAmount + votingAmount) <= maxVotableAmount, "Not enough balance");
    uint256 afterAmount = votingState[msg.sender][subjectId].amount + votingAmount;
    votingState[msg.sender][subjectId].amount = afterAmount;

    emit Voted(subjectId, msg.sender, isYes, votingAmount, address(subject.nft), subject.tokenId, subject.action, subject.requester, subject.fractionAmount, subject.yesVoted, subject.noVoted, afterAmount);
  }

  function removeSubjectId(uint256 id) internal {
    bool removed = false;
    for (uint i = 0; i < progressSubjectIds.length; i++){
      if(progressSubjectIds[i] == id) {
        removed = true;
        delete progressSubjectIds[i];
      } else if(removed) {
        progressSubjectIds[i - 1] = progressSubjectIds[i];
      }
    }
    progressSubjectIds.pop();
  }

  function createSubjectId() internal returns (uint256){
      uint256 subjectId = ++subjectIdIndex;
      progressSubjectIds.push(subjectId);
      return subjectId;
  }

  function addSubject(ERC721 nft,
      uint256 tokenId,
      SubjectAction action,
      address minter,
      uint256 mintAmount) internal returns (uint256){

      uint256 subjectId = createSubjectId();
      subjectIds[nft][tokenId] = subjectId;
      subjects[subjectId].nft = nft;
      subjects[subjectId].tokenId = tokenId;
      subjects[subjectId].action = action;
      subjects[subjectId].requester = minter;
      subjects[subjectId].fractionAmount = mintAmount;
      return subjectId;
  }

  function resolveSubject(ERC721 nft, uint256 tokenId) internal returns (VoteSubject memory){
    uint256 subjectId = subjectIds[nft][tokenId];
    VoteSubject storage subject = subjects[subjectId];
    require(subject.yesVoted >= (totalSupply() / 2), "Not enough votes");
    subject.isEnded = true;
    removeSubjectId(subjectId);
    return subject;
  }

  event MintRequested(
    uint256 subjectId,
    ERC721 nft,
    uint256 tokenId, 
    address minter,
    uint256 mintAmount
  );

  event RedeemRequested(
    uint256 subjectId,
    ERC721 nft,
    uint256 tokenId, 
    address minter,
    uint256 mintAmount
  );

  event Voted(
    uint256 subjectId,
    address voter,
    bool isYes,
    uint256 amount,
    address nft,
    uint256 tokenId, 
    SubjectAction action,
    address minter,
    uint256 mintAmount,
    uint256 yesVoted,
    uint256 noVoted,
    uint256 totalVotedOfVoter);
}

struct VotingState {
  uint256 amount;
}

struct VoteSubject {
  ERC721 nft;
  uint256 tokenId;
  SubjectAction action;
  address requester;
  uint256 fractionAmount;
  uint256 yesVoted;
  uint256 noVoted;
  bool isEnded;
}

enum SubjectAction {
    MINT,
    REDEEM
}
